import React from "react";
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import '../assets/styles/Main.scss';

function Main() {

  return (
    <div className="container">
      <div className="about-section">
        {/* <div className="image-wrapper">
          <img src="https://media.licdn.com/dms/image/D4D03AQFJM4Ac3BTVHw/profile-displayphoto-shrink_800_800/0/1710948101180?e=1723075200&v=beta&t=DcQiJahClGhiZzNNsXghQKrH7C5WKuvxEeQ30OVhSf0" alt="Avatar" />
        </div> */}
        <div className="content">
          <div className="social_icons">
            <a href="https://github.com/shaileep99" target="_blank" rel="noreferrer"><GitHubIcon/></a>
            <a href="https://www.linkedin.com/in/shailee-patel/" target="_blank" rel="noreferrer"><LinkedInIcon/></a>
          </div>
          {/* <h1>Shailee Patel</h1> */}
          <p>Welcome to my digital portfolio, where innovation meets dedication. 
             As a passionate computer science enthusiast, I thrive on transforming complex problems into elegant solutions. 
             With a blend of technical expertise and creative flair, I aim to craft seamless, user-centric experiences. 
             Dive in to explore my journey through code, design, and technology, and discover how I turn ideas into impactful realities.</p>
          <div className="mobile_social_icons">
            <a href="https://github.com/shaileep99" target="_blank" rel="noreferrer"><GitHubIcon/></a>
            <a href="https://www.linkedin.com/in/shailee-patel/" target="_blank" rel="noreferrer"><LinkedInIcon/></a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Main;
